//# sourceMappingURL=bootstrap.min.js.map


$(document).ready(function()
{
if ($("#alertSuccess").text().trim() == "")
{
$("#alertSuccess").hide();
}
$("#alertError").hide();
});
// SAVE ============================================
$(document).on("click", "#btnSave", function(event)
{
// Clear alerts---------------------
$("#alertSuccess").text("");
$("#alertSuccess").hide();
$("#alertError").text("");
$("#alertError").hide();
// Form validation-------------------
var status = validateDrForm();
if (status != true)
{
$("#alertError").text(status);
$("#alertError").show();
return;
}
// If valid------------------------

var type = ($("#hidDrIDSave").val() == "") ? "POST" : "PUT";


$.ajax(
		{
		url : "DoctorsAPI",
		type : type,
		data : $("#formDoctor").serialize(),
		dataType : "text",
		complete : function(response, status)
		{
		onItemSaveComplete(response.responseText, status);
		}
		});


     //$("#formDoctor").submit();

});


function onItemSaveComplete(response, status)
{
if (status == "success")
{
var resultSet = JSON.parse(response);
if (resultSet.status.trim() == "success")
{
$("#alertSuccess").text("Successfully saved.");
$("#alertSuccess").show();
$("#divDoctorsGrid").html(resultSet.data);
} else if (resultSet.status.trim() == "error")
{
$("#alertError").text(resultSet.data);
$("#alertError").show();
}
} else if (status == "error")
{ 
$("#alertError").text("Error while saving.");
$("#alertError").show();
} else
{
$("#alertError").text("Unknown error while saving..");
$("#alertError").show();
}
$("#hidDrIDSave").val("");
$("#formDoctor")[0].reset();
}	



$(document).on("click", ".btnRemove", function(event)
		{
		$.ajax(
		{
		url : "DoctorsAPI",
		type : "DELETE",
		data : "drID=" + $(this).data("drID"),
		dataType : "text",
		complete : function(response, status)
		{
		onDocDeleteComplete(response.responseText, status);
		}
		});
		});






function onDocDeleteComplete(response, status)
{
if (status == "success")
{
var resultSet = JSON.parse(response);
if (resultSet.status.trim() == "success")
{
$("#alertSuccess").text("Successfully deleted.");
$("#alertSuccess").show();
$("#divItemsGrid").html(resultSet.data);
} else if (resultSet.status.trim() == "error")
{
$("#alertError").text(resultSet.data);
$("#alertError").show();
}
} else if (status == "error")
{
$("#alertError").text("Error while deleting.");
$("#alertError").show();
} else
{
$("#alertError").text("Unknown error while deleting..");
$("#alertError").show();
}
}





// UPDATE==========================================
$(document).on("click", ".btnUpdate", function(event)
{
$("#hidDrIDSave").val($(this).closest("tr").find('#hidDoctorIDUpadate').val());
$("#drCode").val($(this).closest("tr").find('td:eq(0)').text());
$("#drName").val($(this).closest("tr").find('td:eq(1)').text());
$("#drSalary").val($(this).closest("tr").find('td:eq(2)').text());
$("#drDesc").val($(this).closest("tr").find('td:eq(3)').text());
});
// CLIENTMODEL=========================================================================
function validateDrForm()
{
// CODE
if ($("#drCode").val().trim() == "")
{
return "Insert Doctor Code.";
}
// NAME
if ($("#drName").val().trim() == "")
{
return "Insert Doctor Name.";
}


//Salary-------------------------------
if ($("#drSalary").val().trim() == "")
{
return "Insert Doctor Salary.";
}
// is numerical value
var tmpPrice = $("#drSalary").val().trim();
if (!$.isNumeric(tmpPrice))
{
return "Insert a numerical value for Doctor Salary.";
}
// convert to decimal Salary
$("#drSalary").val(parseFloat(tmpPrice).toFixed(2));
// DESCRIPTION------------------------
if ($("#drDesc").val().trim() == "")
{
return "Insert Doctor Description.";
}
return true;
}

